    false,nt"url": null,nt"notes": "This template was developed for drafting
    National Wildlife Refuge System (NWRS) Survey Protocols.  The template is arranged
    in the same order as the eight basic protocol elements described in the Survey Protocol
    Handbook.  Formatting is based on MS Office Word styles for the headings and text.
     Fonts for the headings vary between Times New Roman and Arial, depending on the
    heading level.  Text in the body of the protocol should be Times New Roman 12 font.
     Designating styles for headings allows generation of a Table of Contents.  Using
    this template is a simple matter of inserting or composing text, then assigning
    the proper style to the heading.  Instructions for placement or formatting of pictures,
    tables, figures, and appendixes within a survey protocol are also provided.",nt"license_title":
